import ReactDOM from "react-dom/client"
import "./style.css"
const root = ReactDOM.createRoot(document.getElementById("root"))

//Navbar component

function Navbar()
{
    return(
     <nav>
        <h1>Perfumy</h1>
        <ul>
            <li>Home |</li>
            <li>Products |</li>
            <li>About |</li>
            <li>Contact</li>
        </ul>
     </nav>
    )
}

//Search Component
function  Search()
{
    return(
        <div className="searchbar">
            <input type="text" placeholder="search"/>
        </div>
    )
}

root.render(
    <div>
        <Navbar></Navbar>
        <Search></Search>
    </div>
)
